import axios from "axios";
import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

function Product_Detail(){

const param = useParams();
const [data,setData] = useState({});

    useEffect(()=>{
        axios.get("http://localhost:8080/laravel8/laravel8/public/api/product/detail/" + param.id )
        .then(res=>{
            console.log(res)
            setData(res.data.data)
        })

    },[]);

    function renderData(){
        if(Object.keys(data).length > 0){
            return Object.keys(data).map((key,index)=>{
                let images = data.image;
                let img = JSON.parse(images)
                return(
                   
                        <div class="col-sm-5">
                                <div class="view-product">
                                    <img src={"http://localhost:8080/laravel8/laravel8/public/upload/product/" + data.id_user + "/" + img } alt="" />
                                    <a href="images/product-details/1.jpg" rel="prettyPhoto"><h3>ZOOM</h3></a>
                                    
                                </div>
                                <div id="similar-product" class="carousel slide" data-ride="carousel">
                                    
                                        <div class="carousel-inner">
                                            <div class="item active">
                                            <a href=""><img src="images/product-details/similar1.jpg" alt=""/></a>
                                            <a href=""><img src="images/product-details/similar2.jpg" alt=""/></a>
                                            <a href=""><img src="images/product-details/similar3.jpg" alt=""/></a>
                                            </div>
                                            <div class="item">
                                            <a href=""><img src="images/product-details/similar1.jpg" alt=""/></a>
                                            <a href=""><img src="images/product-details/similar2.jpg" alt=""/></a>
                                            <a href=""><img src="images/product-details/similar3.jpg" alt=""/></a>
                                            </div>
                                            <div class="item">
                                            <a href=""><img src="images/product-details/similar1.jpg" alt=""/></a>
                                            <a href=""><img src="images/product-details/similar2.jpg" alt=""/></a>
                                            <a href=""><img src="images/product-details/similar3.jpg" alt=""/></a>
                                            </div>
                                            
                                        </div>

                                    <a class="left item-control" href="#similar-product" data-slide="prev">
                                        <i class="fa fa-angle-left"></i>
                                    </a>
                                    <a class="right item-control" href="#similar-product" data-slide="next">
                                        <i class="fa fa-angle-right"></i>
                                    </a>
                                </div>

                        </div>
                        /* <div class="col-sm-7">
                                <div class="product-information">
                                    <img src="images/product-details/new.jpg" class="newarrival" alt="" />
                                    <h2>{data.name}</h2>
                                    <p>Web ID: {data.id}</p>
                                    <img src="images/product-details/rating.png" alt="" />
                                    <span>
                                        <span>US: {data.price}</span>
                                        <label>Quantity:</label>
                                        <input type="text" value="3" />
                                        <button type="button" class="btn btn-fefault cart">
                                            <i class="fa fa-shopping-cart"></i>
                                            Add to cart
                                        </button>
                                    </span>
                                    <p><b>Availability:</b> In Stock</p>
                                    <p><b>Condition:</b> New</p>
                                    <p><b>Brand:</b> E-SHOPPER</p>
                                    <a href=""><img src="images/product-details/share.png" class="share img-responsive"  alt="" /></a>
                                </div>
                        </div> */
                    
                    

                )
            })
        }
    }

    return(
        
        <div class="product-details"> {renderData()}</div> 
        
    )
    
}
export default Product_Detail;
